// src/components/admin/dashboard/RecentActivities.jsx
import React, { useState, useEffect } from 'react';
import { Link } from 'react-router-dom';
import { 
  Package, User, Settings, AlertCircle,
  Truck, CheckCircle, XCircle, Clock
} from 'lucide-react';

const RecentActivities = () => {
  const [activities, setActivities] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState('');

  useEffect(() => {
    fetchRecentActivities();
  }, []);

  const fetchRecentActivities = async () => {
    try {
      const response = await fetch(`http://localhost:5000/api/admin/logs?limit=10`, {
        headers: {
          'Authorization': `Bearer ${localStorage.getItem('authToken')}`
        }
      });

      const data = await response.json();

      if (!response.ok) {
        throw new Error(data.message);
      }

      setActivities(data);
    } catch (err) {
      setError(err.message);
    } finally {
      setLoading(false);
    }
  };

  const getActivityIcon = (action) => {
    switch (action) {
      case 'courier_created':
        return <Package className="h-5 w-5 text-blue-500" />;
      case 'status_update':
        return <Truck className="h-5 w-5 text-green-500" />;
      case 'user_registered':
        return <User className="h-5 w-5 text-purple-500" />;
      case 'user_updated':
        return <Settings className="h-5 w-5 text-orange-500" />;
      case 'delivery_success':
        return <CheckCircle className="h-5 w-5 text-green-500" />;
      case 'delivery_failed':
        return <XCircle className="h-5 w-5 text-red-500" />;
      default:
        return <Clock className="h-5 w-5 text-gray-500" />;
    }
  };

  const formatTime = (dateString) => {
    const date = new Date(dateString);
    return date.toLocaleTimeString('en-IN', {
      hour: '2-digit',
      minute: '2-digit',
      hour12: true
    });
  };

  if (loading) {
    return (
      <div className="space-y-4">
        {[1, 2, 3, 4, 5].map((i) => (
          <div key={i} className="animate-pulse flex items-center gap-3">
            <div className="w-8 h-8 bg-gray-200 rounded-full"></div>
            <div className="flex-1">
              <div className="h-4 bg-gray-200 rounded w-3/4"></div>
              <div className="mt-1 h-3 bg-gray-200 rounded w-1/2"></div>
            </div>
          </div>
        ))}
      </div>
    );
  }

  if (error) {
    return (
      <div className="text-center py-4">
        <AlertCircle className="h-8 w-8 text-red-500 mx-auto" />
        <p className="mt-2 text-sm text-gray-500">{error}</p>
      </div>
    );
  }

  return (
    <div className="space-y-4">
      {activities.map((activity) => (
        <div key={activity.id} className="flex items-start gap-3 p-3 hover:bg-gray-50 rounded-lg">
          <div className="flex-shrink-0">
            {getActivityIcon(activity.action)}
          </div>
          <div className="flex-1 min-w-0">
            <p className="text-sm font-medium text-gray-900">
              {activity.description}
            </p>
            <div className="mt-1 flex items-center gap-2 text-xs text-gray-500">
              {activity.entity_type && activity.entity_id && (
                <Link
                  to={`/admin/${activity.entity_type}/${activity.entity_id}`}
                  className="text-blue-600 hover:text-blue-800"
                >
                  View Details
                </Link>
              )}
              <span>•</span>
              <span>{formatTime(activity.created_at)}</span>
            </div>
          </div>
        </div>
      ))}

      <div className="pt-4 border-t">
        <Link
          to="/admin/logs"
          className="text-sm text-blue-600 hover:text-blue-800 flex items-center justify-center"
        >
          View All Activity
        </Link>
      </div>
    </div>
  );
};

export default RecentActivities;
